def find_primer_sequence(dna_string):
    """Return a string with the primer sequence of the DNA string.

    Args:
        dna_string (str): The DNA string to search for primer sequence.

    Returns:
        str: The primer sequence of the DNA string.
    """
    primer_sequence = ""
    for i in range(0, len(dna_string)):
        if dna_string[i] == "T":
            primer_sequence += "A"
        elif dna_string[i] == "A":
            primer_sequence += "C"
        elif dna_string[i] == "G":
            primer_sequence += "G"
        else:
            primer_sequence += "T"
    return primer_sequence

