def slice_and_continue(my_list, my_string):
    """
    Write a function that takes a list of strings and a string as arguments and returns a new list with the strings that start with "a" or "e" and end with "o". The function must use slicing and the continue statement to skip the strings that no longer meet the criteria.
    """
    new_list = []
    for i in range(len(my_list)):
        if my_list[i][0] == "a" or my_list[i][0] == "e":
            if my_list[i][1] == "o":
                new_list.append(my_list[i])
            else:
                continue
    return new_list
